Iron Man (2008)  

Verenigde Staten
Actie / Science-Fiction
126 minuten

geregisseerd door Jon Favreau
met Robert Downey Jr., Jeff Bridges en Gwyneth Paltrow

Tony Stark (Robert Downey Jr.) is een multimiljardair, industrialist en bovenal een geniale uitvinder. Hij wordt ontvoerd en gedwongen om een verschrikkelijk wapen te bouwen. In plaats daarvan construeert hij een ingenieus ijzeren pak waarmee hij weet te ontsnappen. Als hij terugkeert in de V.S. ontdekt hij een complot dat de stabiliteit van de wereld in gevaar brengt. Onder zijn alias Iron Man probeert hij het tij te keren.

